  const [task, setTask] = useState([]);
  const [newTask, setNewTask] = useState("");

  function handleInputChange(e) {
    setNewTask(e.target.value);
    setTask((task) => [...task, newTask]);
  }
  function addTask() {}
  function deleteTask() {}
  function moveTaskUp() {}
  function moveTaskDown() {}

  return (
    <div>
      <h1>To Do List</h1>
      <input type="text" placeholder="Enter a task..." />
    </div>
  );
}

export default App;
